import React from 'react';
import PropTypes from 'prop-types';
import Drawer from '../../shared/Drawer/Drawer';

const EditCard = props => {
    const { isCollapsedCard, setIsCollapsedCard, ...editCard } = props;

    return (
        <Drawer isCollapsed={isCollapsedCard} setIsCollapsed={setIsCollapsedCard} {...editCard}>
            Configurations
        </Drawer>
    );
};

EditCard.propTypes = {};

export default EditCard;
